  // Converts a File object to a GoogleGenerativeAI.Part object.
  fileToGenerativePart(file: string): Promise<GenerativeContentBlob> {
    let inlineData = { data: "", mimeType: ""} as GenerativeContentBlob;
    function mimeType(txt: any = ""): string {
      return txt.match(/[^:]\w+\/[\w-+\d.]+(?=;|,)/)?.toString();
    }
    this.fileConversionService.convertToBase64(file)
      .then((img: string) => {
        inlineData.mimeType = mimeType(img);
        inlineData.data = img.slice(inlineData.mimeType.length);
        return inlineData;
      }, (reason) => {
        let erro = `Não converteu a imagem: ${reason}`;
        console.error(erro);
        return erro;
      });
    return new Promise(() => null);
  }

